hebsuperobject.biblemap.put("b6_4_18", new hebsuperobject(6,4,18,"ויהי בעלות הכהנים נשאי ארון ברית יהוה מתוך הירדן נתקו כפות רגלי הכהנים אל החרבה וישבו מי הירדן למקומם וילכו כתמול שלשום על כל גדותיו׃"));
