hebsuperobject.biblemap.put("b6_4_20", new hebsuperobject(6,4,20,"ואת שתים עשרה האבנים האלה אשר לקחו מן הירדן הקים יהושע בגלגל׃"));
hebsuperobject.biblemap.put("b6_4_21", new hebsuperobject(6,4,21,"ויאמר אל בני ישראל לאמר אשר ישאלון בניכם מחר את אבותם לאמר מה האבנים האלה׃"));
