hebsuperobject.biblemap.put("b6_4_24", new hebsuperobject(6,4,24,"למען דעת כל עמי הארץ את יד יהוה כי חזקה היא למען יראתם את יהוה אלהיכם כל הימים׃"));
hebsuperobject.biblemap.put("b6_5_1", new hebsuperobject(6,5,1,"ויהי כשמע כל מלכי האמרי אשר בעבר הירדן ימה וכל מלכי הכנעני אשר על הים את אשר הוביש יהוה את מי הירדן מפני בני ישראל עד עברנו וימס לבבם ולא היה בם עוד רוח מפני בני ישראל׃"));
hebsuperobject.biblemap.put("b6_5_2", new hebsuperobject(6,5,2,"בעת ההיא אמר יהוה אל יהושע עשה לך חרבות צרים ושוב מל את בני ישראל שנית׃"));
hebsuperobject.biblemap.put("b6_5_3", new hebsuperobject(6,5,3,"ויעש לו יהושע חרבות צרים וימל את בני ישראל אל גבעת הערלות׃"));
