hebsuperobject.biblemap.put("b6_5_5", new hebsuperobject(6,5,5,"כי מלים היו כל העם היצאים וכל העם הילדים במדבר בדרך בצאתם ממצרים לא מלו׃"));
hebsuperobject.biblemap.put("b6_5_6", new hebsuperobject(6,5,6,"כי ארבעים שנה הלכו בני ישראל במדבר עד תם כל הגוי אנשי המלחמה היצאים ממצרים אשר לא שמעו בקול יהוה אשר נשבע יהוה להם לבלתי הראותם את הארץ אשר נשבע יהוה לאבותם לתת לנו ארץ זבת חלב ודבש׃"));
hebsuperobject.biblemap.put("b6_5_7", new hebsuperobject(6,5,7,"ואת בניהם הקים תחתם אתם מל יהושע כי ערלים היו כי לא מלו אותם בדרך׃"));
