hebsuperobject.biblemap.put("b6_5_14", new hebsuperobject(6,5,14,"ויאמר לא כי אני שר צבא יהוה עתה באתי ויפל יהושע אל פניו ארצה וישתחו ויאמר לו מה אדני מדבר אל עבדו׃"));
