hebsuperobject.biblemap.put("b6_6_6", new hebsuperobject(6,6,6,"ויקרא יהושע בן נון אל הכהנים ויאמר אלהם שאו את ארון הברית ושבעה כהנים ישאו שבעה שופרות יובלים לפני ארון יהוה׃"));
hebsuperobject.biblemap.put("b6_6_7", new hebsuperobject(6,6,7,"ויאמרו אל העם עברו וסבו את העיר והחלוץ יעבר לפני ארון יהוה׃"));
