hebsuperobject.biblemap.put("b6_7_6", new hebsuperobject(6,7,6,"ויקרע יהושע שמלתיו ויפל על פניו ארצה לפני ארון יהוה עד הערב הוא וזקני ישראל ויעלו עפר על ראשם׃"));
