hebsuperobject.biblemap.put("b6_7_21", new hebsuperobject(6,7,21,"ואראה בשלל אדרת שנער אחת טובה ומאתים שקלים כסף ולשון זהב אחד חמשים שקלים משקלו ואחמדם ואקחם והנם טמונים בארץ בתוך האהלי והכסף תחתיה׃"));
hebsuperobject.biblemap.put("b6_7_22", new hebsuperobject(6,7,22,"וישלח יהושע מלאכים וירצו האהלה והנה טמונה באהלו והכסף תחתיה׃"));
hebsuperobject.biblemap.put("b6_7_23", new hebsuperobject(6,7,23,"ויקחום מתוך האהל ויבאום אל יהושע ואל כל בני ישראל ויצקם לפני יהוה׃"));
hebsuperobject.biblemap.put("b6_7_24", new hebsuperobject(6,7,24,"ויקח יהושע את עכן בן זרח ואת הכסף ואת האדרת ואת לשון הזהב ואת בניו ואת בנתיו ואת שורו ואת חמרו ואת צאנו ואת אהלו ואת כל אשר לו וכל ישראל עמו ויעלו אתם עמק עכור׃"));
hebsuperobject.biblemap.put("b6_7_25", new hebsuperobject(6,7,25,"ויאמר יהושע מה עכרתנו יעכרך יהוה ביום הזה וירגמו אתו כל ישראל אבן וישרפו אתם באש ויסקלו אתם באבנים׃"));
hebsuperobject.biblemap.put("b6_7_26", new hebsuperobject(6,7,26,"ויקימו עליו גל אבנים גדול עד היום הזה וישב יהוה מחרון אפו על כן קרא שם המקום ההוא עמק עכור עד היום הזה׃"));
hebsuperobject.biblemap.put("b6_8_1", new hebsuperobject(6,8,1,"ויאמר יהוה אל יהושע אל תירא ואל תחת קח עמך את כל עם המלחמה וקום עלה העי ראה נתתי בידך את מלך העי ואת עמו ואת עירו ואת ארצו׃"));
hebsuperobject.biblemap.put("b6_8_2", new hebsuperobject(6,8,2,"ועשית לעי ולמלכה כאשר עשית ליריחו ולמלכה רק שללה ובהמתה תבזו לכם שים לך ארב לעיר מאחריה׃"));
hebsuperobject.biblemap.put("b6_8_3", new hebsuperobject(6,8,3,"ויקם יהושע וכל עם המלחמה לעלות העי ויבחר יהושע שלשים אלף איש גבורי החיל וישלחם לילה׃"));
hebsuperobject.biblemap.put("b6_8_4", new hebsuperobject(6,8,4,"ויצו אתם לאמר ראו אתם ארבים לעיר מאחרי העיר אל תרחיקו מן העיר מאד והייתם כלכם נכנים׃"));
hebsuperobject.biblemap.put("b6_8_5", new hebsuperobject(6,8,5,"ואני וכל העם אשר אתי נקרב אל העיר והיה כי יצאו לקראתנו כאשר בראשנה ונסנו לפניהם׃"));
hebsuperobject.biblemap.put("b6_8_6", new hebsuperobject(6,8,6,"ויצאו אחרינו עד התיקנו אותם מן העיר כי יאמרו נסים לפנינו כאשר בראשנה ונסנו לפניהם׃"));
hebsuperobject.biblemap.put("b6_8_7", new hebsuperobject(6,8,7,"ואתם תקמו מהאורב והורשתם את העיר ונתנה יהוה אלהיכם בידכם׃"));
hebsuperobject.biblemap.put("b6_8_8", new hebsuperobject(6,8,8,"והיה כתפשכם את העיר תציתו את העיר באש כדבר יהוה תעשו ראו צויתי אתכם׃"));
hebsuperobject.biblemap.put("b6_8_9", new hebsuperobject(6,8,9,"וישלחם יהושע וילכו אל המארב וישבו בין בית אל ובין העי מים לעי וילן יהושע בלילה ההוא בתוך העם׃"));
hebsuperobject.biblemap.put("b6_8_10", new hebsuperobject(6,8,10,"וישכם יהושע בבקר ויפקד את העם ויעל הוא וזקני ישראל לפני העם העי׃"));
hebsuperobject.biblemap.put("b6_8_11", new hebsuperobject(6,8,11,"וכל העם המלחמה אשר אתו עלו ויגשו ויבאו נגד העיר ויחנו מצפון לעי והגי בינו ובין העי׃"));
hebsuperobject.biblemap.put("b6_8_12", new hebsuperobject(6,8,12,"ויקח כחמשת אלפים איש וישם אותם ארב בין בית אל ובין העי מים לעיר׃"));
hebsuperobject.biblemap.put("b6_8_13", new hebsuperobject(6,8,13,"וישימו העם את כל המחנה אשר מצפון לעיר ואת עקבו מים לעיר וילך יהושע בלילה ההוא בתוך העמק׃"));
hebsuperobject.biblemap.put("b6_8_14", new hebsuperobject(6,8,14,"ויהי כראות מלך העי וימהרו וישכימו ויצאו אנשי העיר לקראת ישראל למלחמה הוא וכל עמו למועד לפני הערבה והוא לא ידע כי ארב לו מאחרי העיר׃"));
hebsuperobject.biblemap.put("b6_8_15", new hebsuperobject(6,8,15,"וינגעו יהושע וכל ישראל לפניהם וינסו דרך המדבר׃"));
hebsuperobject.biblemap.put("b6_8_16", new hebsuperobject(6,8,16,"ויזעקו כל העם אשר בעיר לרדף אחריהם וירדפו אחרי יהושע וינתקו מן העיר׃"));
hebsuperobject.biblemap.put("b6_8_17", new hebsuperobject(6,8,17,"ולא נשאר איש בעי ובית אל אשר לא יצאו אחרי ישראל ויעזבו את העיר פתוחה וירדפו אחרי ישראל׃"));
hebsuperobject.biblemap.put("b6_8_18", new hebsuperobject(6,8,18,"ויאמר יהוה אל יהושע נטה בכידון אשר בידך אל העי כי בידך אתננה ויט יהושע בכידון אשר בידו אל העיר׃"));
hebsuperobject.biblemap.put("b6_8_19", new hebsuperobject(6,8,19,"והאורב קם מהרה ממקומו וירוצו כנטות ידו ויבאו העיר וילכדוה וימהרו ויציתו את העיר באש׃"));
hebsuperobject.biblemap.put("b6_8_20", new hebsuperobject(6,8,20,"ויפנו אנשי העי אחריהם ויראו והנה עלה עשן העיר השמימה ולא היה בהם ידים לנוס הנה והנה והעם הנס המדבר נהפך אל הרודף׃"));
hebsuperobject.biblemap.put("b6_8_21", new hebsuperobject(6,8,21,"ויהושע וכל ישראל ראו כי לכד הארב את העיר וכי עלה עשן העיר וישבו ויכו את אנשי העי׃"));
hebsuperobject.biblemap.put("b6_8_22", new hebsuperobject(6,8,22,"ואלה יצאו מן העיר לקראתם ויהיו לישראל בתוך אלה מזה ואלה מזה ויכו אותם עד בלתי השאיר לו שריד ופליט׃"));
hebsuperobject.biblemap.put("b6_8_23", new hebsuperobject(6,8,23,"ואת מלך העי תפשו חי ויקרבו אתו אל יהושע׃"));
hebsuperobject.biblemap.put("b6_8_24", new hebsuperobject(6,8,24,"ויהי ככלות ישראל להרג את כל ישבי העי בשדה במדבר אשר רדפום בו ויפלו כלם לפי חרב עד תמם וישבו כל ישראל העי ויכו אתה לפי חרב׃"));
hebsuperobject.biblemap.put("b6_8_25", new hebsuperobject(6,8,25,"ויהי כל הנפלים ביום ההוא מאיש ועד אשה שנים עשר אלף כל אנשי העי׃"));
hebsuperobject.biblemap.put("b6_8_26", new hebsuperobject(6,8,26,"ויהושע לא השיב ידו אשר נטה בכידון עד אשר החרים את כל ישבי העי׃"));
hebsuperobject.biblemap.put("b6_8_27", new hebsuperobject(6,8,27,"רק הבהמה ושלל העיר ההיא בזזו להם ישראל כדבר יהוה אשר צוה את יהושע׃"));
hebsuperobject.biblemap.put("b6_8_28", new hebsuperobject(6,8,28,"וישרף יהושע את העי וישימה תל עולם שממה עד היום הזה׃"));
hebsuperobject.biblemap.put("b6_8_29", new hebsuperobject(6,8,29,"ואת מלך העי תלה על העץ עד עת הערב וכבוא השמש צוה יהושע וירידו את נבלתו מן העץ וישליכו אותה אל פתח שער העיר ויקימו עליו גל אבנים גדול עד היום הזה׃"));
hebsuperobject.biblemap.put("b6_8_30", new hebsuperobject(6,8,30,"אז יבנה יהושע מזבח ליהוה אלהי ישראל בהר עיבל׃"));
hebsuperobject.biblemap.put("b6_8_31", new hebsuperobject(6,8,31,"כאשר צוה משה עבד יהוה את בני ישראל ככתוב בספר תורת משה מזבח אבנים שלמות אשר לא הניף עליהן ברזל ויעלו עליו עלות ליהוה ויזבחו שלמים׃"));
hebsuperobject.biblemap.put("b6_8_32", new hebsuperobject(6,8,32,"ויכתב שם על האבנים את משנה תורת משה אשר כתב לפני בני ישראל׃"));
hebsuperobject.biblemap.put("b6_8_33", new hebsuperobject(6,8,33,"וכל ישראל וזקניו ושטרים ושפטיו עמדים מזה ומזה לארון נגד הכהנים הלוים נשאי ארון ברית יהוה כגר כאזרח חציו אל מול הר גרזים והחציו אל מול הר עיבל כאשר צוה משה עבד יהוה לברך את העם ישראל בראשנה׃"));
hebsuperobject.biblemap.put("b6_8_34", new hebsuperobject(6,8,34,"ואחרי כן קרא את כל דברי התורה הברכה והקללה ככל הכתוב בספר התורה׃"));
hebsuperobject.biblemap.put("b6_8_35", new hebsuperobject(6,8,35,"לא היה דבר מכל אשר צוה משה אשר לא קרא יהושע נגד כל קהל ישראל והנשים והטף והגר ההלך בקרבם׃"));
hebsuperobject.biblemap.put("b6_9_1", new hebsuperobject(6,9,1,"ויהי כשמע כל המלכים אשר בעבר הירדן בהר ובשפלה ובכל חוף הים הגדול אל מול הלבנון החתי והאמרי הכנעני הפרזי החוי והיבוסי׃"));
hebsuperobject.biblemap.put("b6_9_2", new hebsuperobject(6,9,2,"ויתקבצו יחדו להלחם עם יהושע ועם ישראל פה אחד׃"));
hebsuperobject.biblemap.put("b6_9_3", new hebsuperobject(6,9,3,"וישבי גבעון שמעו את אשר עשה יהושע ליריחו ולעי׃"));
hebsuperobject.biblemap.put("b6_9_4", new hebsuperobject(6,9,4,"ויעשו גם המה בערמה וילכו ויצטירו ויקחו שקים בלים לחמוריהם ונאדות יין בלים ומבקעים ומצררים׃"));
hebsuperobject.biblemap.put("b6_9_5", new hebsuperobject(6,9,5,"ונעלות בלות ומטלאות ברגליהם ושלמות בלות עליהם וכל לחם צידם יבש היה נקדים׃"));
hebsuperobject.biblemap.put("b6_9_6", new hebsuperobject(6,9,6,"וילכו אל יהושע אל המחנה הגלגל ויאמרו אליו ואל איש ישראל מארץ רחוקה באנו ועתה כרתו לנו ברית׃"));
hebsuperobject.biblemap.put("b6_9_7", new hebsuperobject(6,9,7,"ויאמרו איש ישראל אל החוי אולי בקרבי אתה יושב ואיך אכרות לך ברית׃"));
hebsuperobject.biblemap.put("b6_9_8", new hebsuperobject(6,9,8,"ויאמרו אל יהושע עבדיך אנחנו ויאמר אלהם יהושע מי אתם ומאין תבאו׃"));
hebsuperobject.biblemap.put("b6_9_9", new hebsuperobject(6,9,9,"ויאמרו אליו מארץ רחוקה מאד באו עבדיך לשם יהוה אלהיך כי שמענו שמעו ואת כל אשר עשה במצרים׃"));
hebsuperobject.biblemap.put("b6_9_10", new hebsuperobject(6,9,10,"ואת כל אשר עשה לשני מלכי האמרי אשר בעבר הירדן לסיחון מלך חשבון ולעוג מלך הבשן אשר בעשתרות׃"));
hebsuperobject.biblemap.put("b6_9_11", new hebsuperobject(6,9,11,"ויאמרו אלינו זקינינו וכל ישבי ארצנו לאמר קחו בידכם צידה לדרך ולכו לקראתם ואמרתם אליהם עבדיכם אנחנו ועתה כרתו לנו ברית׃"));
hebsuperobject.biblemap.put("b6_9_12", new hebsuperobject(6,9,12,"זה לחמנו חם הצטידנו אתו מבתינו ביום צאתנו ללכת אליכם ועתה הנה יבש והיה נקדים׃"));
hebsuperobject.biblemap.put("b6_9_13", new hebsuperobject(6,9,13,"ואלה נאדות היין אשר מלאנו חדשים והנה התבקעו ואלה שלמותינו ונעלינו בלו מרב הדרך מאד׃"));
hebsuperobject.biblemap.put("b6_9_14", new hebsuperobject(6,9,14,"ויקחו האנשים מצידם ואת פי יהוה לא שאלו׃"));
hebsuperobject.biblemap.put("b6_9_15", new hebsuperobject(6,9,15,"ויעש להם יהושע שלום ויכרת להם ברית לחיותם וישבעו להם נשיאי העדה׃"));
hebsuperobject.biblemap.put("b6_9_16", new hebsuperobject(6,9,16,"ויהי מקצה שלשת ימים אחרי אשר כרתו להם ברית וישמעו כי קרבים הם אליו ובקרבו הם ישבים׃"));
hebsuperobject.biblemap.put("b6_9_17", new hebsuperobject(6,9,17,"ויסעו בני ישראל ויבאו אל עריהם ביום השלישי ועריהם גבעון והכפירה ובארות וקרית יערים׃"));
hebsuperobject.biblemap.put("b6_9_18", new hebsuperobject(6,9,18,"ולא הכום בני ישראל כי נשבעו להם נשיאי העדה ביהוה אלהי ישראל וילנו כל העדה על הנשיאים׃"));
hebsuperobject.biblemap.put("b6_9_19", new hebsuperobject(6,9,19,"ויאמרו כל הנשיאים אל כל העדה אנחנו נשבענו להם ביהוה אלהי ישראל ועתה לא נוכל לנגע בהם׃"));
hebsuperobject.biblemap.put("b6_9_20", new hebsuperobject(6,9,20,"זאת נעשה להם והחיה אותם ולא יהיה עלינו קצף על השבועה אשר נשבענו להם׃"));
hebsuperobject.biblemap.put("b6_9_21", new hebsuperobject(6,9,21,"ויאמרו אליהם הנשיאים יחיו ויהיו חטבי עצים ושאבי מים לכל העדה כאשר דברו להם הנשיאים׃"));
hebsuperobject.biblemap.put("b6_9_22", new hebsuperobject(6,9,22,"ויקרא להם יהושע וידבר אליהם לאמר למה רמיתם אתנו לאמר רחוקים אנחנו מכם מאד ואתם בקרבנו ישבים׃"));
hebsuperobject.biblemap.put("b6_9_23", new hebsuperobject(6,9,23,"ועתה ארורים אתם ולא יכרת מכם עבד וחטבי עצים ושאבי מים לבית אלהי׃"));
hebsuperobject.biblemap.put("b6_9_24", new hebsuperobject(6,9,24,"ויענו את יהושע ויאמרו כי הגד הגד לעבדיך את אשר צוה יהוה אלהיך את משה עבדו לתת לכם את כל הארץ ולהשמיד את כל ישבי הארץ מפניכם ונירא מאד לנפשתינו מפניכם ונעשה את הדבר הזה׃"));
hebsuperobject.biblemap.put("b6_9_25", new hebsuperobject(6,9,25,"ועתה הננו בידך כטוב וכישר בעיניך לעשות לנו עשה׃"));
hebsuperobject.biblemap.put("b6_9_26", new hebsuperobject(6,9,26,"ויעש להם כן ויצל אותם מיד בני ישראל ולא הרגום׃"));
hebsuperobject.biblemap.put("b6_9_27", new hebsuperobject(6,9,27,"ויתנם יהושע ביום ההוא חטבי עצים ושאבי מים לעדה ולמזבח יהוה עד היום הזה אל המקום אשר יבחר׃"));
hebsuperobject.biblemap.put("b6_10_1", new hebsuperobject(6,10,1,"ויהי כשמע אדני צדק מלך ירושלם כי לכד יהושע את העי ויחרימה כאשר עשה ליריחו ולמלכה כן עשה לעי ולמלכה וכי השלימו ישבי גבעון את ישראל ויהיו בקרבם׃"));
hebsuperobject.biblemap.put("b6_10_2", new hebsuperobject(6,10,2,"וייראו מאד כי עיר גדולה גבעון כאחת ערי הממלכה וכי היא גדולה מן העי וכל אנשיה גברים׃"));
hebsuperobject.biblemap.put("b6_10_3", new hebsuperobject(6,10,3,"וישלח אדני צדק מלך ירושלם אל הוהם מלך חברון ואל פראם מלך ירמות ואל יפיע מלך לכיש ואל דביר מלך עגלון לאמר׃"));
hebsuperobject.biblemap.put("b6_10_4", new hebsuperobject(6,10,4,"עלו אלי ועזרני ונכה את גבעון כי השלימה את יהושע ואת בני ישראל׃"));
hebsuperobject.biblemap.put("b6_10_5", new hebsuperobject(6,10,5,"ויאספו ויעלו חמשת מלכי האמרי מלך ירושלם מלך חברון מלך ירמות מלך לכיש מלך עגלון הם וכל מחניהם ויחנו על גבעון וילחמו עליה׃"));
hebsuperobject.biblemap.put("b6_10_6", new hebsuperobject(6,10,6,"וישלחו אנשי גבעון אל יהושע אל המחנה הגלגלה לאמר אל תרף ידיך מעבדיך עלה אלינו מהרה והושיעה לנו ועזרנו כי נקבצו אלינו כל מלכי האמרי ישבי ההר׃"));
