hebsuperobject.biblemap.put("b6_21_35", new hebsuperobject(6,21,35,"את דמנה ואת מגרשה את נהלל ואת מגרשה ערים ארבע׃"));
hebsuperobject.biblemap.put("b6_21_36", new hebsuperobject(6,21,36,"וממטה ראובן את בצר ואת מגרשה ואת יהצה ואת מגרשה׃"));
hebsuperobject.biblemap.put("b6_21_37", new hebsuperobject(6,21,37,"את קדמות ואת מגרשה ואת מיפעת ואת מגרשה ערים ארבע׃"));
hebsuperobject.biblemap.put("b6_21_38", new hebsuperobject(6,21,38,"וממטה גד את עיר מקלט הרצח את רמת בגלעד ואת מגרשה ואת מחנים ואת מגרשה׃"));
hebsuperobject.biblemap.put("b6_21_39", new hebsuperobject(6,21,39,"את חשבון ואת מגרשה את יעזר ואת מגרשה כל ערים ארבע׃"));
hebsuperobject.biblemap.put("b6_21_40", new hebsuperobject(6,21,40,"כל הערים לבני מררי למשפחתם הנותרים ממשפחות הלוים ויהי גורלם ערים שתים עשרה׃"));
hebsuperobject.biblemap.put("b6_21_41", new hebsuperobject(6,21,41,"כל ערי הלוים בתוך אחזת בני ישראל ערים ארבעים ושמנה ומגרשיהן׃"));
hebsuperobject.biblemap.put("b6_21_42", new hebsuperobject(6,21,42,"תהיינה הערים האלה עיר עיר ומגרשיה סביבתיה כן לכל הערים האלה׃"));
hebsuperobject.biblemap.put("b6_21_43", new hebsuperobject(6,21,43,"ויתן יהוה לישראל את כל הארץ אשר נשבע לתת לאבותם וירשוה וישבו בה׃"));
hebsuperobject.biblemap.put("b6_21_44", new hebsuperobject(6,21,44,"וינח יהוה להם מסביב ככל אשר נשבע לאבותם ולא עמד איש בפניהם מכל איביהם את כל איביהם נתן יהוה בידם׃"));
hebsuperobject.biblemap.put("b6_21_45", new hebsuperobject(6,21,45,"לא נפל דבר מכל הדבר הטוב אשר דבר יהוה אל בית ישראל הכל בא׃"));
hebsuperobject.biblemap.put("b6_22_1", new hebsuperobject(6,22,1,"אז יקרא יהושע לראובני ולגדי ולחצי מטה מנשה׃"));
hebsuperobject.biblemap.put("b6_22_2", new hebsuperobject(6,22,2,"ויאמר אליהם אתם שמרתם את כל אשר צוה אתכם משה עבד יהוה ותשמעו בקולי לכל אשר צויתי אתכם׃"));
hebsuperobject.biblemap.put("b6_22_3", new hebsuperobject(6,22,3,"לא עזבתם את אחיכם זה ימים רבים עד היום הזה ושמרתם את משמרת מצות יהוה אלהיכם׃"));
hebsuperobject.biblemap.put("b6_22_4", new hebsuperobject(6,22,4,"ועתה הניח יהוה אלהיכם לאחיכם כאשר דבר להם ועתה פנו ולכו לכם לאהליכם אל ארץ אחזתכם אשר נתן לכם משה עבד יהוה בעבר הירדן׃"));
hebsuperobject.biblemap.put("b6_22_5", new hebsuperobject(6,22,5,"רק שמרו מאד לעשות את המצוה ואת התורה אשר צוה אתכם משה עבד יהוה לאהבה את יהוה אלהיכם וללכת בכל דרכיו ולשמר מצותיו ולדבקה בו ולעבדו בכל לבבכם ובכל נפשכם׃"));
hebsuperobject.biblemap.put("b6_22_6", new hebsuperobject(6,22,6,"ויברכם יהושע וישלחם וילכו אל אהליהם׃"));
hebsuperobject.biblemap.put("b6_22_7", new hebsuperobject(6,22,7,"ולחצי שבט המנשה נתן משה בבשן ולחציו נתן יהושע עם אחיהם מעבר הירדן ימה וגם כי שלחם יהושע אל אהליהם ויברכם׃"));
hebsuperobject.biblemap.put("b6_22_8", new hebsuperobject(6,22,8,"ויאמר אליהם לאמר בנכסים רבים שובו אל אהליכם ובמקנה רב מאד בכסף ובזהב ובנחשת ובברזל ובשלמות הרבה מאד חלקו שלל איביכם עם אחיכם׃"));
hebsuperobject.biblemap.put("b6_22_9", new hebsuperobject(6,22,9,"וישבו וילכו בני ראובן ובני גד וחצי שבט המנשה מאת בני ישראל משלה אשר בארץ כנען ללכת אל ארץ הגלעד אל ארץ אחזתם אשר נאחזו בה על פי יהוה ביד משה׃"));
hebsuperobject.biblemap.put("b6_22_10", new hebsuperobject(6,22,10,"ויבאו אל גלילות הירדן אשר בארץ כנען ויבנו בני ראובן ובני גד וחצי שבט המנשה שם מזבח על הירדן מזבח גדול למראה׃"));
hebsuperobject.biblemap.put("b6_22_11", new hebsuperobject(6,22,11,"וישמעו בני ישראל לאמר הנה בנו בני ראובן ובני גד וחצי שבט המנשה את המזבח אל מול ארץ כנען אל גלילות הירדן אל עבר בני ישראל׃"));
hebsuperobject.biblemap.put("b6_22_12", new hebsuperobject(6,22,12,"וישמעו בני ישראל ויקהלו כל עדת בני ישראל שלה לעלות עליהם לצבא׃"));
hebsuperobject.biblemap.put("b6_22_13", new hebsuperobject(6,22,13,"וישלחו בני ישראל אל בני ראובן ואל בני גד ואל חצי שבט מנשה אל ארץ הגלעד את פינחס בן אלעזר הכהן׃"));
hebsuperobject.biblemap.put("b6_22_14", new hebsuperobject(6,22,14,"ועשרה נשאים עמו נשיא אחד נשיא אחד לבית אב לכל מטות ישראל ואיש ראש בית אבותם המה לאלפי ישראל׃"));
hebsuperobject.biblemap.put("b6_22_15", new hebsuperobject(6,22,15,"ויבאו אל בני ראובן ואל בני גד ואל חצי שבט מנשה אל ארץ הגלעד וידברו אתם לאמר׃"));
hebsuperobject.biblemap.put("b6_22_16", new hebsuperobject(6,22,16,"כה אמרו כל עדת יהוה מה המעל הזה אשר מעלתם באלהי ישראל לשוב היום מאחרי יהוה בבנותכם לכם מזבח למרדכם היום ביהוה׃"));
hebsuperobject.biblemap.put("b6_22_17", new hebsuperobject(6,22,17,"המעט לנו את עון פעור אשר לא הטהרנו ממנו עד היום הזה ויהי הנגף בעדת יהוה׃"));
hebsuperobject.biblemap.put("b6_22_18", new hebsuperobject(6,22,18,"ואתם תשבו היום מאחרי יהוה והיה אתם תמרדו היום ביהוה ומחר אל כל עדת ישראל יקצף׃"));
hebsuperobject.biblemap.put("b6_22_19", new hebsuperobject(6,22,19,"ואך אם טמאה ארץ אחזתכם עברו לכם אל ארץ אחזת יהוה אשר שכן שם משכן יהוה והאחזו בתוכנו וביהוה אל תמרדו ואתנו אל תמרדו בבנתכם לכם מזבח מבלעדי מזבח יהוה אלהינו׃"));
hebsuperobject.biblemap.put("b6_22_20", new hebsuperobject(6,22,20,"הלוא עכן בן זרח מעל מעל בחרם ועל כל עדת ישראל היה קצף והוא איש אחד לא גוע בעונו׃"));
hebsuperobject.biblemap.put("b6_22_21", new hebsuperobject(6,22,21,"ויענו בני ראובן ובני גד וחצי שבט המנשה וידברו את ראשי אלפי ישראל׃"));
hebsuperobject.biblemap.put("b6_22_22", new hebsuperobject(6,22,22,"אל אלהים יהוה אל אלהים יהוה הוא ידע וישראל הוא ידע אם במרד ואם במעל ביהוה אל תושיענו היום הזה׃"));
hebsuperobject.biblemap.put("b6_22_23", new hebsuperobject(6,22,23,"לבנות לנו מזבח לשוב מאחרי יהוה ואם להעלות עליו עולה ומנחה ואם לעשות עליו זבחי שלמים יהוה הוא יבקש׃"));
hebsuperobject.biblemap.put("b6_22_24", new hebsuperobject(6,22,24,"ואם לא מדאגה מדבר עשינו את זאת לאמר מחר יאמרו בניכם לבנינו לאמר מה לכם וליהוה אלהי ישראל׃"));
hebsuperobject.biblemap.put("b6_22_25", new hebsuperobject(6,22,25,"וגבול נתן יהוה ביננו וביניכם בני ראובן ובני גד את הירדן אין לכם חלק ביהוה והשביתו בניכם את בנינו לבלתי ירא את יהוה׃"));
hebsuperobject.biblemap.put("b6_22_26", new hebsuperobject(6,22,26,"ונאמר נעשה נא לנו לבנות את המזבח לא לעולה ולא לזבח׃"));
hebsuperobject.biblemap.put("b6_22_27", new hebsuperobject(6,22,27,"כי עד הוא בינינו וביניכם ובין דרותינו אחרינו לעבד את עבדת יהוה לפניו בעלותינו ובזבחינו ובשלמינו ולא יאמרו בניכם מחר לבנינו אין לכם חלק ביהוה׃"));
hebsuperobject.biblemap.put("b6_22_28", new hebsuperobject(6,22,28,"ונאמר והיה כי יאמרו אלינו ואל דרתינו מחר ואמרנו ראו את תבנית מזבח יהוה אשר עשו אבותינו לא לעולה ולא לזבח כי עד הוא בינינו וביניכם׃"));
hebsuperobject.biblemap.put("b6_22_29", new hebsuperobject(6,22,29,"חלילה לנו ממנו למרד ביהוה ולשוב היום מאחרי יהוה לבנות מזבח לעלה למנחה ולזבח מלבד מזבח יהוה אלהינו אשר לפני משכנו׃"));
hebsuperobject.biblemap.put("b6_22_30", new hebsuperobject(6,22,30,"וישמע פינחס הכהן ונשיאי העדה וראשי אלפי ישראל אשר אתו את הדברים אשר דברו בני ראובן ובני גד ובני מנשה וייטב בעיניהם׃"));
hebsuperobject.biblemap.put("b6_22_31", new hebsuperobject(6,22,31,"ויאמר פינחס בן אלעזר הכהן אל בני ראובן ואל בני גד ואל בני מנשה היום ידענו כי בתוכנו יהוה אשר לא מעלתם ביהוה המעל הזה אז הצלתם את בני ישראל מיד יהוה׃"));
hebsuperobject.biblemap.put("b6_22_32", new hebsuperobject(6,22,32,"וישב פינחס בן אלעזר הכהן והנשיאים מאת בני ראובן ומאת בני גד מארץ הגלעד אל ארץ כנען אל בני ישראל וישבו אותם דבר׃"));
hebsuperobject.biblemap.put("b6_22_33", new hebsuperobject(6,22,33,"וייטב הדבר בעיני בני ישראל ויברכו אלהים בני ישראל ולא אמרו לעלות עליהם לצבא לשחת את הארץ אשר בני ראובן ובני גד ישבים בה׃"));
hebsuperobject.biblemap.put("b6_22_34", new hebsuperobject(6,22,34,"ויקראו בני ראובן ובני גד למזבח כי עד הוא בינתינו כי יהוה האלהים׃"));
hebsuperobject.biblemap.put("b6_23_1", new hebsuperobject(6,23,1,"ויהי מימים רבים אחרי אשר הניח יהוה לישראל מכל איביהם מסביב ויהושע זקן בא בימים׃"));
hebsuperobject.biblemap.put("b6_23_2", new hebsuperobject(6,23,2,"ויקרא יהושע לכל ישראל לזקניו ולראשיו ולשפטיו ולשטריו ויאמר אלהם אני זקנתי באתי בימים׃"));
hebsuperobject.biblemap.put("b6_23_3", new hebsuperobject(6,23,3,"ואתם ראיתם את כל אשר עשה יהוה אלהיכם לכל הגוים האלה מפניכם כי יהוה אלהיכם הוא הנלחם לכם׃"));
hebsuperobject.biblemap.put("b6_23_4", new hebsuperobject(6,23,4,"ראו הפלתי לכם את הגוים הנשארים האלה בנחלה לשבטיכם מן הירדן וכל הגוים אשר הכרתי והים הגדול מבוא השמש׃"));
hebsuperobject.biblemap.put("b6_23_5", new hebsuperobject(6,23,5,"ויהוה אלהיכם הוא יהדפם מפניכם והוריש אתם מלפניכם וירשתם את ארצם כאשר דבר יהוה אלהיכם לכם׃"));
hebsuperobject.biblemap.put("b6_23_6", new hebsuperobject(6,23,6,"וחזקתם מאד לשמר ולעשות את כל הכתוב בספר תורת משה לבלתי סור ממנו ימין ושמאול׃"));
hebsuperobject.biblemap.put("b6_23_7", new hebsuperobject(6,23,7,"לבלתי בוא בגוים האלה הנשארים האלה אתכם ובשם אלהיהם לא תזכירו ולא תשביעו ולא תעבדום ולא תשתחוו להם׃"));
hebsuperobject.biblemap.put("b6_23_8", new hebsuperobject(6,23,8,"כי אם ביהוה אלהיכם תדבקו כאשר עשיתם עד היום הזה׃"));
hebsuperobject.biblemap.put("b6_23_9", new hebsuperobject(6,23,9,"ויורש יהוה מפניכם גוים גדלים ועצומים ואתם לא עמד איש בפניכם עד היום הזה׃"));
hebsuperobject.biblemap.put("b6_23_10", new hebsuperobject(6,23,10,"איש אחד מכם ירדף אלף כי יהוה אלהיכם הוא הנלחם לכם כאשר דבר לכם׃"));
hebsuperobject.biblemap.put("b6_23_11", new hebsuperobject(6,23,11,"ונשמרתם מאד לנפשתיכם לאהבה את יהוה אלהיכם׃"));
hebsuperobject.biblemap.put("b6_23_12", new hebsuperobject(6,23,12,"כי אם שוב תשובו ודבקתם ביתר הגוים האלה הנשארים האלה אתכם והתחתנתם בהם ובאתם בהם והם בכם׃"));
hebsuperobject.biblemap.put("b6_23_13", new hebsuperobject(6,23,13,"ידוע תדעו כי לא יוסיף יהוה אלהיכם להוריש את הגוים האלה מלפניכם והיו לכם לפח ולמוקש ולשטט בצדיכם ולצננים בעיניכם עד אבדכם מעל האדמה הטובה הזאת אשר נתן לכם יהוה אלהיכם׃"));
hebsuperobject.biblemap.put("b6_23_14", new hebsuperobject(6,23,14,"והנה אנכי הולך היום בדרך כל הארץ וידעתם בכל לבבכם ובכל נפשכם כי לא נפל דבר אחד מכל הדברים הטובים אשר דבר יהוה אלהיכם עליכם הכל באו לכם לא נפל ממנו דבר אחד׃"));
hebsuperobject.biblemap.put("b6_23_15", new hebsuperobject(6,23,15,"והיה כאשר בא עליכם כל הדבר הטוב אשר דבר יהוה אלהיכם אליכם כן יביא יהוה עליכם את כל הדבר הרע עד השמידו אותכם מעל האדמה הטובה הזאת אשר נתן לכם יהוה אלהיכם׃"));
hebsuperobject.biblemap.put("b6_23_16", new hebsuperobject(6,23,16,"בעברכם את ברית יהוה אלהיכם אשר צוה אתכם והלכתם ועבדתם אלהים אחרים והשתחויתם להם וחרה אף יהוה בכם ואבדתם מהרה מעל הארץ הטובה אשר נתן לכם׃"));
hebsuperobject.biblemap.put("b6_24_1", new hebsuperobject(6,24,1,"ויאסף יהושע את כל שבטי ישראל שכמה ויקרא לזקני ישראל ולראשיו ולשפטיו ולשטריו ויתיצבו לפני האלהים׃"));
hebsuperobject.biblemap.put("b6_24_2", new hebsuperobject(6,24,2,"ויאמר יהושע אל כל העם כה אמר יהוה אלהי ישראל בעבר הנהר ישבו אבותיכם מעולם תרח אבי אברהם ואבי נחור ויעבדו אלהים אחרים׃"));
hebsuperobject.biblemap.put("b6_24_3", new hebsuperobject(6,24,3,"ואקח את אביכם את אברהם מעבר הנהר ואולך אותו בכל ארץ כנען וארב את זרעו ואתן לו את יצחק׃"));
hebsuperobject.biblemap.put("b6_24_4", new hebsuperobject(6,24,4,"ואתן ליצחק את יעקב ואת עשו ואתן לעשו את הר שעיר לרשת אותו ויעקב ובניו ירדו מצרים׃"));
hebsuperobject.biblemap.put("b6_24_5", new hebsuperobject(6,24,5,"ואשלח את משה ואת אהרן ואגף את מצרים כאשר עשיתי בקרבו ואחר הוצאתי אתכם׃"));
hebsuperobject.biblemap.put("b6_24_6", new hebsuperobject(6,24,6,"ואוציא את אבותיכם ממצרים ותבאו הימה וירדפו מצרים אחרי אבותיכם ברכב ובפרשים ים סוף׃"));
hebsuperobject.biblemap.put("b6_24_7", new hebsuperobject(6,24,7,"ויצעקו אל יהוה וישם מאפל ביניכם ובין המצרים ויבא עליו את הים ויכסהו ותראינה עיניכם את אשר עשיתי במצרים ותשבו במדבר ימים רבים׃"));
hebsuperobject.biblemap.put("b6_24_8", new hebsuperobject(6,24,8,"ואביאה אתכם אל ארץ האמרי היושב בעבר הירדן וילחמו אתכם ואתן אותם בידכם ותירשו את ארצם ואשמידם מפניכם׃"));
hebsuperobject.biblemap.put("b6_24_9", new hebsuperobject(6,24,9,"ויקם בלק בן צפור מלך מואב וילחם בישראל וישלח ויקרא לבלעם בן בעור לקלל אתכם׃"));
hebsuperobject.biblemap.put("b6_24_10", new hebsuperobject(6,24,10,"ולא אביתי לשמע לבלעם ויברך ברוך אתכם ואצל אתכם מידו׃"));
hebsuperobject.biblemap.put("b6_24_11", new hebsuperobject(6,24,11,"ותעברו את הירדן ותבאו אל יריחו וילחמו בכם בעלי יריחו האמרי והפרזי והכנעני והחתי והגרגשי החוי והיבוסי ואתן אותם בידכם׃"));
hebsuperobject.biblemap.put("b6_24_12", new hebsuperobject(6,24,12,"ואשלח לפניכם את הצרעה ותגרש אותם מפניכם שני מלכי האמרי לא בחרבך ולא בקשתך׃"));
hebsuperobject.biblemap.put("b6_24_13", new hebsuperobject(6,24,13,"ואתן לכם ארץ אשר לא יגעת בה וערים אשר לא בניתם ותשבו בהם כרמים וזיתים אשר לא נטעתם אתם אכלים׃"));
hebsuperobject.biblemap.put("b6_24_14", new hebsuperobject(6,24,14,"ועתה יראו את יהוה ועבדו אתו בתמים ובאמת והסירו את אלהים אשר עבדו אבותיכם בעבר הנהר ובמצרים ועבדו את יהוה׃"));
hebsuperobject.biblemap.put("b6_24_15", new hebsuperobject(6,24,15,"ואם רע בעיניכם לעבד את יהוה בחרו לכם היום את מי תעבדון אם את אלהים אשר עבדו אבותיכם אשר בעבר הנהר ואם את אלהי האמרי אשר אתם ישבים בארצם ואנכי וביתי נעבד את יהוה׃"));
hebsuperobject.biblemap.put("b6_24_16", new hebsuperobject(6,24,16,"ויען העם ויאמר חלילה לנו מעזב את יהוה לעבד אלהים אחרים׃"));
hebsuperobject.biblemap.put("b6_24_17", new hebsuperobject(6,24,17,"כי יהוה אלהינו הוא המעלה אתנו ואת אבותינו מארץ מצרים מבית עבדים ואשר עשה לעינינו את האתות הגדלות האלה וישמרנו בכל הדרך אשר הלכנו בה ובכל העמים אשר עברנו בקרבם׃"));
hebsuperobject.biblemap.put("b6_24_18", new hebsuperobject(6,24,18,"ויגרש יהוה את כל העמים ואת האמרי ישב הארץ מפנינו גם אנחנו נעבד את יהוה כי הוא אלהינו׃"));
hebsuperobject.biblemap.put("b6_24_19", new hebsuperobject(6,24,19,"ויאמר יהושע אל העם לא תוכלו לעבד את יהוה כי אלהים קדשים הוא אל קנוא הוא לא ישא לפשעכם ולחטאותיכם׃"));
hebsuperobject.biblemap.put("b6_24_20", new hebsuperobject(6,24,20,"כי תעזבו את יהוה ועבדתם אלהי נכר ושב והרע לכם וכלה אתכם אחרי אשר היטיב לכם׃"));
hebsuperobject.biblemap.put("b6_24_21", new hebsuperobject(6,24,21,"ויאמר העם אל יהושע לא כי את יהוה נעבד׃"));
hebsuperobject.biblemap.put("b6_24_22", new hebsuperobject(6,24,22,"ויאמר יהושע אל העם עדים אתם בכם כי אתם בחרתם לכם את יהוה לעבד אותו ויאמרו עדים׃"));
hebsuperobject.biblemap.put("b6_24_23", new hebsuperobject(6,24,23,"ועתה הסירו את אלהי הנכר אשר בקרבכם והטו את לבבכם אל יהוה אלהי ישראל׃"));
hebsuperobject.biblemap.put("b6_24_24", new hebsuperobject(6,24,24,"ויאמרו העם אל יהושע את יהוה אלהינו נעבד ובקולו נשמע׃"));
hebsuperobject.biblemap.put("b6_24_25", new hebsuperobject(6,24,25,"ויכרת יהושע ברית לעם ביום ההוא וישם לו חק ומשפט בשכם׃"));
hebsuperobject.biblemap.put("b6_24_26", new hebsuperobject(6,24,26,"ויכתב יהושע את הדברים האלה בספר תורת אלהים ויקח אבן גדולה ויקימה שם תחת האלה אשר במקדש יהוה׃"));
hebsuperobject.biblemap.put("b6_24_27", new hebsuperobject(6,24,27,"ויאמר יהושע אל כל העם הנה האבן הזאת תהיה בנו לעדה כי היא שמעה את כל אמרי יהוה אשר דבר עמנו והיתה בכם לעדה פן תכחשון באלהיכם׃"));
hebsuperobject.biblemap.put("b6_24_28", new hebsuperobject(6,24,28,"וישלח יהושע את העם איש לנחלתו׃"));
hebsuperobject.biblemap.put("b6_24_29", new hebsuperobject(6,24,29,"ויהי אחרי הדברים האלה וימת יהושע בן נון עבד יהוה בן מאה ועשר שנים׃"));
hebsuperobject.biblemap.put("b6_24_30", new hebsuperobject(6,24,30,"ויקברו אתו בגבול נחלתו בתמנת סרח אשר בהר אפרים מצפון להר געש׃"));
hebsuperobject.biblemap.put("b6_24_31", new hebsuperobject(6,24,31,"ויעבד ישראל את יהוה כל ימי יהושע וכל ימי הזקנים אשר האריכו ימים אחרי יהושע ואשר ידעו את כל מעשה יהוה אשר עשה לישראל׃"));
hebsuperobject.biblemap.put("b6_24_32", new hebsuperobject(6,24,32,"ואת עצמות יוסף אשר העלו בני ישראל ממצרים קברו בשכם בחלקת השדה אשר קנה יעקב מאת בני חמור אבי שכם במאה קשיטה ויהיו לבני יוסף לנחלה׃"));
hebsuperobject.biblemap.put("b6_24_33", new hebsuperobject(6,24,33,"ואלעזר בן אהרן מת ויקברו אתו בגבעת פינחס בנו אשר נתן לו בהר אפרים׃"));

